&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Con Mi primer avi&oacute;n LEGO&reg; DUPLO&reg;, los peque&ntilde;os pilotos se mantienen entretenidos durante horas. Este sencillo modelo es perfecto para contribuir al desarrollo de las habilidades motrices. Adem&aacute;s, el ladrillo decorado con forma de ventanilla despierta la imaginaci&oacute;n, dando lugar a grandes historias y juegos de interpretaci&oacute;n. &iexcl;Cuando el avi&oacute;n haya aterrizado, podr&aacute;s convertirlo en un barco o un helic&oacute;ptero! Los ladrillos DUPLO est&aacute;n dise&ntilde;ados especialmente para resultar divertidos y proporcionar seguridad en las manos de los m&aacute;s peque&ntilde;os.&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Tema: Duplo&lt;/li&gt;
&lt;li&gt;Contiene un avi&oacute;n para construir con h&eacute;lice que gira.&lt;/li&gt;
&lt;li&gt;Incluye tambi&eacute;n un ladrillo decorado con personajes por ambas caras como punto de partida para divertidas historias.&lt;/li&gt;
&lt;li&gt;Tu peque&ntilde;o inventar&aacute; un sinf&iacute;n de aventuras en el aire con este simp&aacute;tico avi&oacute;n.&lt;/li&gt;
&lt;li&gt;Ayuda a tu hijo a desarrollar sus habilidades b&aacute;sicas de construcci&oacute;n con este sencillo modelo.&lt;/li&gt;
&lt;li&gt;Este set se puede convertir en un barco o un helic&oacute;ptero.&lt;/li&gt;
&lt;li&gt;Los productos LEGO&reg; DUPLO&reg; se dise&ntilde;an espec&iacute;ficamente para ser divertidos y f&aacute;ciles de usar en las manos de los m&aacute;s peque&ntilde;os.&lt;/li&gt;
&lt;li&gt;Este set proporciona una experiencia de construcci&oacute;n y juego apropiada para ni&ntilde;os de 18 meses a 3 a&ntilde;os.&lt;/li&gt;
&lt;li&gt;El avi&oacute;n mide m&aacute;s de 7 cm de altura, 10 cm de longitud y 9 cm de ancho.&lt;/li&gt;
&lt;li&gt;Edad: 1&frac12; - 3&lt;/li&gt;
&lt;li&gt;Piezas: 10&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;T&eacute;rminos y condiciones:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;* Tienda Oficial de LEGO&reg;.&lt;/p&gt;
&lt;p&gt;* Garant&iacute;a: Sujetas a la marca.&lt;/p&gt;
&lt;p&gt;* Tiempo de entrega: De 6 a 10 d&iacute;as habiles a partir de la aprobaci&oacute;n del pago.&lt;/p&gt;
&lt;p&gt;* Valido hasta agotar existencias.&lt;/p&gt;
&lt;p&gt;* Unidades limitadas.&lt;/p&gt;
&lt;p&gt;* Precios sujetos a cambios sin previo aviso.&lt;/p&gt;

